import React from 'react';
import SubmitExpense from './pages/SubmitExpense';
import ExpensesList from './pages/ExpensesList';

export default function App(){
  return (
    <div style={{ padding: 20 }}>
      <h2>Expense Management</h2>
      <SubmitExpense />
      <hr />
      <ExpensesList />
    </div>
  );
}
